import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav>
            <ul>
                <li><Link to="/home">Home</Link></li>
                <li><Link to="/sobreEmpresa">Sobre a Empresa</Link></li>
                <li><Link to="/servicos">Serviços</Link></li>
                <li><Link to="/projetos">Projetos</Link></li>
                <li><Link to="/contato">Contato</Link></li>
                <li><Link to="/homePortfolio">Home Portfólio</Link></li>
                <li><Link to="/sobreMim">Sobre Mim</Link></li>
                <li><Link to="/competenciaPortfolio">Competências</Link></li>
                <li><Link to="/projetosPortfolio">Projetos Portfólio</Link></li>
                <li><Link to="/contatoPortfolio">Contato Portfólio</Link></li>
            </ul>
        </nav>
    );
}

export default Navbar;
